import React from "react";
import "./ThemeSelector.css"; // Ensure you have the corresponding CSS file if needed

const ThemeSelector = () => {
  return (
    <div className="ThemeSelector">
      <button
        onClick={() => (document.documentElement.className = "light-theme")}
      >
        Light
      </button>
      <button
        onClick={() => (document.documentElement.className = "dark-theme")}
      >
        Dark
      </button>
      <button
        onClick={() => (document.documentElement.className = "neon-theme")}
      >
        Neon
      </button>
      <button
        onClick={() => (document.documentElement.className = "ocean-theme")}
      >
        Ocean
      </button>
      <button
        onClick={() => (document.documentElement.className = "sunset-theme")}
      >
        Sunset
      </button>
      <button
        onClick={() => (document.documentElement.className = "pastel-theme")}
      >
        Pastel
      </button>
      <button
        onClick={() => (document.documentElement.className = "forest-theme")}
      >
        Forest
      </button>
    </div>
  );
};

export default ThemeSelector;
